function computeTaxes(row){ 
    var amount=$.parseFloat($(row).find('[name *="[amount]"]').val());
    var tax_list=[];
    var tax_inputs=[];
    row.find('[name*="[__tax_id]"]').each(function(){
            var deleted=$(this).parents(':first').find('[name*="[deleted]"]');
            if(deleted.length == 0 || parseInt(deleted.val())==0){
    	var taxInput=row.find('[name="'+ $(this).attr('name').replace('__','') +'"]');
                var taxID=taxInput.val();
                if(taxID != ""){
		    tax_list.push({'tax_id':taxID,'amount':amount});
		    tax_inputs.push(taxInput); 	
                }
            }
	});
	$.getJSON($.config['base']+'accounting/taxes/_compute_tax_amount?tax_list='+encodeURIComponent(JSON.stringify(tax_list)),function(data){
		$.each(tax_inputs,function(k,v){
			var length=data['tax_list'].length;
			var taxID=$(v).val();
			for(var i=0; i < length ; i++){
				if(data['tax_list'][i]['tax_id'] == taxID){
					$(v).data('tax_amount',data['tax_list'][i]['tax_amount']);
				}
			}
		});
		computeTotals($(row));
	});	
}
// tax-sub-total, sub-total, total.
function computeTotals(row){ 
    var subtotal=0;
    var total=0;
    var form=$(row).closest('form');
    form.find('[name *="[amount]"]:visible').each(function(){
        var num = $.parseFloat($(this).val());
        if($.isNumeric(num)){
            subtotal += num;
        }
    });
    form.find('[name *="[subtotal]"]:visible').val($.format(subtotal,'n'));
    var taxes={};
    form.find('[name *="[amount]"]:visible').each(function(){
        var row=$(this).closest('.last-data-row');
        row.find('[name*="[__tax_id]"]').each(function(){
            var deleted=$(this).parents(':first').find('[name*="[deleted]"]');
            if(deleted.length == 0 || parseInt(deleted.val())==0){
                var taxLabel=$(this).val();
		var taxInput=row.find('[name="'+ $(this).attr('name').replace('__','') +'"]');
                var taxID=taxInput.val();
                if(taxID != ""){
                    if(!$.isset(taxes["id_"+taxID])){
                        taxes["id_"+taxID]={
                            'id':taxID,
                            'amount':$(taxInput).data('tax_amount'),
                            'label':taxLabel
                        };
                    }
                }
            }
        });
    });
    $('.row_invoice_taxes').remove();
    var subtotalRow=$('[name *="data[invoices][subtotal]"]').closest('tr');
    var cnt=0;
    $.each(taxes,function(k,v){
        cnt++;
        var clone= subtotalRow.clone(false);
        clone.addClass('row_invoice_taxes').find('label').html(v['label']);
        clone.find('input').attr({
            'value':v['amount'],
            'name':'data[invoices][invoice_taxes]['+ cnt +'][tax_code_amount]',
            'id':'data-invoices-invoice_taxes-'+ cnt +'-tax_code_amount'
        }).after('<input type="hidden" name="data[invoices][invoice_taxes]['+ cnt +'][tax_code_id]" value="'+v['id']+'">');
        subtotalRow.after(clone);
    });
    form.find('[name *="[tax_code_amount]"]').each(function(){
        var num = $.parseFloat($(this).val());
        if($.isNumeric(num)){
            total += num;
        }
    });
    total += subtotal;
    form.find('[name *="[total]"]').val($.format(total,'n'));
}

