$('#__FORM_ID__').find('[name="data[invoices][partner_id]"]').change(function(event){
    var partnerID=$(this).val();    
    var form=$(this).closest('form');
    if(partnerID != ''){
        $.getJSON($.config['base']+'crm/accounts/view.json?id='+partnerID,function(response){
            var addresses={};
            if($.isset(response['data']) 
            && $.isset(response['data']['accounts'])
            && $.isset(response['data']['accounts']['addresses'])
            ){
            $.each(response['data']['accounts']['addresses'],function(k,v){
                addresses[v['__type'].toLowerCase()] = v;  
            });
            }
            if(!$.isset(addresses['billing']) && $.isset(addresses['mailing'])){
                addresses['billing']=addresses['mailing'];
            }
            if(!$.isset(addresses['shipping']) && $.isset(addresses['billing'])){
                addresses['shipping']=addresses['billing'];
            }
               
            if($.isset(addresses['billing'])){
                form.find('[name *="[billing_address_line_1]"]').val(addresses['billing']['address_line_1']);
                form.find('[name *="[billing_address_line_2]"]').val(addresses['billing']['address_line_2']);
                form.find('[name *="[billing_city]"]').val(addresses['billing']['city']);
                form.find('[name *="[billing_state]"]').val(addresses['billing']['state']);
                form.find('[name *="[billing_country]"]').val(addresses['billing']['country']);
                form.find('[name *="[__billing_country]"]').val(addresses['billing']['__country']);
                form.find('[name *="[billing_zip]"]').val(addresses['billing']['zip']);
            }
            if($.isset(addresses['shipping'])){
                form.find('[name *="[shipping_address_line_1]"]').val(addresses['shipping']['address_line_1']);
                form.find('[name *="[shipping_address_line_2]"]').val(addresses['shipping']['address_line_2']);
                form.find('[name *="[shipping_city]"]').val(addresses['shipping']['city']);
                form.find('[name *="[shipping_state]"]').val(addresses['shipping']['state']);
                form.find('[name *="[shipping_country]"]').val(addresses['shipping']['country']);
                form.find('[name *="[__shipping_country]"]').val(addresses['shipping']['__country']);
                form.find('[name *="[shipping_zip]"]').val(addresses['shipping']['zip']);
            }
              
        });
    }
        event.stopImmediatePropagation();
        event.stopPropagation();
        return false;
});

